import React, { useState } from 'react';
import axios from 'axios';
import './signup-student.css';

const SignupStudent = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [department, setDepartment] = useState('');
  const [year, setYear] = useState('');
  const [error, setError] = useState('');
  const [isSignedUp, setIsSignedUp] = useState(false);

  const handleSignup = async () => {
    if (password !== confirmPassword) {
      setError('Passwords do not match');
      return;
    }

    try {
      const response = await axios.post('http://localhost:4000/signup-student', { email, password, department, year });
      console.log('Response:', response);
      setIsSignedUp(true);
    } catch (error) {
      console.error('Error:', error);
      setError(error.response?.data?.message || 'An error occurred');
    }
  };

  if (isSignedUp) {
    window.location.href = '/home';
  }

  return (
    <div className='signup-container-student'>
      <h1 className='signup-header'>Signup</h1>
      <div className='signup-inner-container'>
        <label>Email</label>
        <input
          type="text"
          placeholder="E-Mail "
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          className="input-field"
        />
      </div>
      <div className='signup-inner-container'>
        <label>Password</label>
        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="input-field"
        />
      </div>
      <div className='signup-inner-container'>
        <label>Confirm Password</label>
        <input
          type="password"
          placeholder="Confirm Password"
          value={confirmPassword}
          onChange={(e) => setConfirmPassword(e.target.value)}
          className="input-field"
        />
      </div>
      
      <div className='signup-student-deparment'>
        <label className='signup-department-label'>Select Department:</label>
        <div className='signup-department-options'>
          <div className='signup-department-inner'>
            <input
              type="radio"
              name="department"
              value="IT"
              checked={department === 'IT'}
              onChange={() => setDepartment('IT')}
            />
            <label>IT</label>
          </div>
          <div className='signup-department-inner'>
            <input
              type="radio"
              name="department"
              value="CSE"
              checked={department === 'CSE'}
              onChange={() => setDepartment('CSE')}
            />
            <label>CSE</label>
          </div>
          <div className='signup-department-inner'>
            <input
              type="radio"
              name="department"
              value="ECE"
              checked={department === 'ECE'}
              onChange={() => setDepartment('ECE')}
            />
            <label>ECE</label>
          </div>
          {/* Add more department options as needed */}
        </div>
      </div>

      <div className='singup-student-year'>
        <label>Select Year:</label>
        <div className='signup-year-inner'>
          <input
            type="radio"
            name="year"
            value="1"
            checked={year === '1'}
            onChange={() => setYear('1')}
          />
          <label>1</label>
        </div>
        <div className='signup-year-inner'>
          <input
            type="radio"
            name="year"
            value="2"
            checked={year === '2'}
            onChange={() => setYear('2')}
          />
          <label>2</label>
        </div>
        <div className='signup-year-inner'>
          <input
            type="radio"
            name="year"
            value="3"
            checked={year === '3'}
            onChange={() => setYear('3')}
          />
          <label>3</label>
        </div>
        <div className='signup-year-inner'>
          <input
            type="radio"
            name="year"
            value="4"
            checked={year === '4'}
            onChange={() => setYear('4')}
          />
          <label>4</label>
        </div>
        {/* Add more years as needed */}
      </div>
      <button onClick={handleSignup} className='signup-button'>Signup</button>
      {error && <p className="error-message">{error}</p>}
    </div>
  );
};

export default SignupStudent;
